window.bookSummaryJSON = "<p>Now that Nora has been outed as an underworlder, all she wants to do is lay low, figure out how to hide her fey heritage, and decide if she wants to date any of the men in her life. Unfortunately, fate has other plans. </p> <p>Just one week after the werewolf fiasco, Terrance is nearly killed by an unknown attacker. He's not the only victim. Fey all around the city are being murdered and with Nora's reputation for solving cases, they're looking to her for help. What choice does she have but to get involved? Not only does being fey make her a target, but the killer went after her troll. He's going to pay for that. </p> <p>Contains mature themes.</p>"; 
